import{_ as e,o as a,c as r,O as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 38.2-1346 Licensure.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/38.2-1346.md","filePath":"vacode/38.2-1346.md"}'),n={name:"vacode/38.2-1346.md"},i=t('<h1 id="§-38-2-1346-licensure" tabindex="-1">§ 38.2-1346 Licensure. <a class="header-anchor" href="#§-38-2-1346-licensure" aria-label="Permalink to &quot;§ 38.2-1346 Licensure.&quot;">​</a></h1><p>A. No person shall act in this Commonwealth as a producer, and no resident of this Commonwealth shall act as a producer, unless such person or resident is licensed as an insurance agent pursuant to the provisions of Chapter 18 (§ <a href="http://law.lis.virginia.gov/vacode/38.2-1800/" target="_blank" rel="noreferrer">38.2-1800</a> et seq.) of this title, or as a reinsurance intermediary or managing general agent pursuant to the provisions of this chapter.</p><p>B. As used in this section, the terms &quot;resident&quot; and &quot;insurance agent&quot; have the meanings prescribed in § <a href="http://law.lis.virginia.gov/vacode/38.2-1800/" target="_blank" rel="noreferrer">38.2-1800</a>, and the terms &quot;managing general agent,&quot; and &quot;reinsurance intermediary&quot; have the meanings set forth in §§ <a href="http://law.lis.virginia.gov/vacode/38.2-1347/" target="_blank" rel="noreferrer">38.2-1347</a> and <a href="http://law.lis.virginia.gov/vacode/38.2-1358/" target="_blank" rel="noreferrer">38.2-1358</a>.</p><p>1993, c. 158; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0706" target="_blank" rel="noreferrer">706</a>.</p>',4),o=[i];function s(c,l,h,d,p,u){return a(),r("div",null,o)}const f=e(n,[["render",s]]);export{g as __pageData,f as default};
